const payAppTypes = NETSWebToApp.PayAppType;
const dimmerDivId = 'netswebtoapp_dimmer_div';
const modalBgDivId = 'netswebtoapp_modal_bg_div';


function showPaymentModal(paymentManagerInstance) {
    const paymentOptionsText = 'Select Payment Option';

    let dimmerDivStyle = "background: rgba(0, 0, 0, 0.5);" +
        "height: 100%;" +
        "position: fixed;" +
        "width: 100%;" +
        "top: 0%;" +
        "left: 0%" +
        "overflow: auto;"+
        "z-index: 9997;";

    let modalBgStyle = "background: rgba(0, 0, 0, 0.0);" +
        "height: 100%;" +
        "position: absolute;" +
        "width: 100%;" +
        "top: 0%;" +
        "left: 0%" +
        "z-index: 9998;";

    let parentDivStyle = "padding: 8px;" +
        "background: rgba(255,255,255,1);" +
        "top: 20%;" +
        "left: 10%;" +
        "width: 80%;" +
        "position: absolute;" +
        "resize: vertical;" +
        "border-radius: 4px;" +
        "color: rgba(255,255,255,1);" +
        "font-family: Helvetica;" +
        "font-size: 20px;" +
        "text-align: center;" +
        "z-index: 9999;";

    let titleStyle = "text-align: center;" +
        "font-weight: bold;" +
        "color: rgba(144,144,144,1);" +
        "font-size: 6vw;" +
        "margin-bottom: 4%;" +
        "margin-top: 4%;";

    let dimmerDiv = "<div style='"+ dimmerDivStyle +"' id='" + dimmerDivId + "'></div>";
    let newDiv = "<div style='" + modalBgStyle + "' id='" + modalBgDivId+ "'>" +
        "<div style='" + parentDivStyle + "'>" +
        "<div style='" + titleStyle + "'>" + paymentOptionsText + "</div>";

    let supportedPaymentTypes = paymentManagerInstance.getAllowedPaymentMethods();

    if (supportedPaymentTypes.length === 0) {
        return;
    } else if (supportedPaymentTypes.length === 1) {
        let scheme = payAppTypes["_$wrappers"][supportedPaymentTypes[0]].scheme;
        let deepUrl = paymentManagerInstance.getDeepLinkUrl(scheme);

        console.log(deepUrl);
        window.location.href = deepUrl;
        return;
    }

    for (let i = 0; i < supportedPaymentTypes.length; i++) {
        let payType = supportedPaymentTypes[i];
        newDiv += getDivForScheme(payType);
    }

    newDiv += "</div></div>";

    document.body.insertAdjacentHTML("afterbegin", dimmerDiv);
    document.body.insertAdjacentHTML("afterbegin", newDiv);
    document.body.focus();

    document.getElementById(dimmerDivId).onclick = function (e) {
        let dimmerDivElement = document.getElementById(dimmerDivId);
        let modalBgElement = document.getElementById(modalBgDivId);
        let senderElement = e.target;
        if (senderElement === dimmerDivElement) {
            dimmerDivElement.parentNode.removeChild(dimmerDivElement);
            modalBgElement.parentNode.removeChild(modalBgElement);
        }
    };


    for(let i = 0; i < supportedPaymentTypes.length; i++){
        let payType = supportedPaymentTypes[i];
        addClickListener(payType, paymentManagerInstance)
    }
}

function addClickListener(payType, paymentManager) {
    let elementPrefix = 'netswebtoapp_';
    let elementSuffix = '_selection_div';
    let paymentElementId = elementPrefix +
        payAppTypes["_$wrappers"][payType].scheme +
        elementSuffix;

    document.body.focus();

    document.getElementById(paymentElementId).onclick = function (e) {
        let deepUrl = paymentManager.getDeepLinkUrl(payAppTypes["_$wrappers"][payType].scheme);

        console.log(deepUrl);
        let modalBg = document.getElementById(modalBgDivId);
        let dimmerDiv = document.getElementById(dimmerDivId);
        dimmerDiv.parentNode.removeChild(dimmerDiv);
        modalBg.parentNode.removeChild(modalBg);
        window.location.href = deepUrl;
    };
}

function getDivForScheme(payType) {
    let paymentLogo;
    let paymentElementId;
    let elementPrefix = 'netswebtoapp_';
    let elementSuffix = '_selection_div';
    let paymentLabel;

    let childDivStyle = '';
    let imgStyle = '';

    if(window.innerHeight > window.innerWidth){
        childDivStyle += "padding: 8px;" +
            "color: rgba(64,64,64, 1);" +
            "font-family: Helvetica;" +
            "margin-bottom: 5%;" +
            "font-size: 5vw;" +
            "text-align: left;";
        imgStyle += "height: 8vh;" +
            "min-height: 8vh;" +
            "max-height: 8vh;" +
            "margin-right: 10%;" +
            "margin-left: 10%;" +
            "vertical-align: middle";
    } else {
        childDivStyle += "padding: 8px;" +
            "color: rgba(64,64,64, 1);" +
            "font-family: Helvetica;" +
            "margin-bottom: 5%;" +
            "font-size: 5vw;" +
            "text-align: left;";
        imgStyle += "height: 8vw;" +
            "min-height: 8vw;" +
            "max-height: 8vw;" +
            "margin-right: 10%;" +
            "margin-left: 20%;" +
            "vertical-align: middle";
    }

    paymentElementId = elementPrefix +
        payAppTypes["_$wrappers"][payType].scheme +
        elementSuffix;

    switch (payType) {
        case NETSWebToApp.PayAppType.NETSPAY: {
            paymentLogo = NETSWebToAppNetspayLogoEnabled;
            paymentLabel = 'NETSPay';
            break;
        }
        case NETSWebToApp.PayAppType.DBS_PAYLAH: {
            paymentLogo = NETSWebToAppDbsPaylahLogo;
            paymentLabel = 'DBS PayLah';
            break;
        }
        case NETSWebToApp.PayAppType.OCBC_PAYANYONE: {
            paymentLogo = NETSWebToAppOcbcPayAnyoneLogoEnabled;
            paymentLabel = 'OCBC PayAnyone';
            break;
        }
        case NETSWebToApp.PayAppType.UOB_MIGHTY: {
            paymentLogo = NETSWebToAppUobMightyLogoEnabled;
            paymentLabel = 'UOB Mighty';
            break;
        }
        default: {
            return '';
        }
    }

    return "<div style='" + childDivStyle + "' id='" + paymentElementId + "'>" +
        "<img src='" + paymentLogo + "' style='" + imgStyle + "'/>" +
        paymentLabel +
        "</div>";
}


